import React from 'react';

import NavBar from './Nav';
import { Link } from 'react-router-dom';

class ResultPage extends React.Component{
  constructor(props){
    super(props);
    this.state={
      vehicles:'',
      pickUpDate:''
    }
  }

  handleParentData = (formModel) => {
    this.setState({...formModel});
  }

  componentDidMount(){
    fetch('http://localhost:8081/api/get')
    .then(res=>res.json())
    .then((data)=>{
        this.setState({vehicles : data})
        
    }).catch(console.log) 
}

render(){ 
    
    var filterData=this.state.vehicles;
    return(
      <div>
          <NavBar/>,
       <FilterForm data={filterData}/>  
      </div>
    );
  } 
}
var createReactClass = require('create-react-class');
var FilterForm = createReactClass({
  getInitialState:function(){
    return{
      data:[],
      vehicle_TYPE:''
    }
  },
  handleChange:function(val){
    this.setState({vehicle_TYPE:val});
    var filteredData = this.props.data.filter(function(item){
      return item.vehicle_TYPE === val;
    });
    this.setState({data:filteredData});
    console.log(filteredData,val);
  },
  render:function(){
    return(
      <div>
        <h2>Vehicle Type</h2>
      <FilterOptions data={this.state.data} changeOption={this.handleChange}/>
      <FilterItems data ={this.state.data}/>
    </div>
    );
  }
});
var FilterOptions = createReactClass({
  getInitialState:function(){
    return{
      data:this.props.data,
      vehicle_TYPE:''
    }
  },
  handleChange:function(e){
    var val= e.target.value;
    this.setState({vehicle_TYPE:val});
    this.props.changeOption(val);
  },
  render:function(){
    return(
      <select id="filterDropdrown" value={this.state.vehicle_TYPE} onChange={this.handleChange}>
        <option value=" "></option>
        <option value="Car">Car</option>
        <option value="MotorBike">MotorBike</option>
      </select>
    );
  }
});
var FilterItems = createReactClass({
  render:function(){
    return(
      <div>
        {this.props.data.map(function(item){
            return(
              <div className="card">
                            <div className="card-body" >
                                 <label >Vehicle Type:{item.vehicle_TYPE} </label> 
                                 <label>Make:{item.make} </label>
                                 <label>Model:{item.model} </label>
                                <label>Number Of Seats:{item.numOfSeats} </label>
                                <label>Rate:{item.priceRate} </label>
                                <label >Plate Number:{item.plateNum} </label>
                                <label>A/C Availability:{item.acAvailability} </label>
                                <label >Color:{item.color} </label>
                                <label>Number of Doors:{item.numOfDoors} </label>
                                <label >Transmission:{item.transmission} </label>
                                <label >TankCapacity:{item.tankCapacity} </label>
                                <label>Luggage Weight:{item.luggageWeight} </label>
                                <label >Number of seats:{item.numOfSeats} </label>
                                <Link to="/booking"><button>Book</button></Link>
                             </div>
                        </div>
            );
        })}
      </div>
    )
  }
});
export default ResultPage;
